import React from "react";
import "./App.css";
import {
    BrowserRouter as Router,
    Link,
    Route,
    Switch,
    useRouteMatch,
    useParams
} from "react-router-dom";

function App() {
    return (
        <Router>
            <div className="App">
                <h1>Belajar Router</h1>

                <nav>
                    <Link to="/">Home</Link>&nbsp;|&nbsp;
                    <Link to="/about">About</Link>&nbsp;|&nbsp;
                    <Link to="/users">Users</Link>&nbsp;|&nbsp;
                    <Link to="/topics">Topics</Link>
                </nav>

                <Switch>
                    <Route path="/about">
                        <About />
                    </Route>
                    <Route path="/users">
                        <Users />
                    </Route>
                    <Route path="/topics">
                        <Topics />
                    </Route>
                    <Route path="/">
                        <Home />
                    </Route>
                </Switch>
            </div>
        </Router>
    );
}

const Home = () => (
    <div>
        <h2>Home</h2>
        <p>
            Laboris minim cillum amet magna ipsum ex dolor qui veniam enim. Sunt
            nisi et exercitation aliqua sunt elit duis minim deserunt
            exercitation. Tempor eu amet laborum fugiat nulla. Culpa dolore
            minim aliquip excepteur aliqua anim dolor. Voluptate sint nisi
            cillum elit sunt.
        </p>
    </div>
);

const About = () => (
    <div>
        <h2>About</h2>
        <p>
            Laboris minim cillum amet magna ipsum ex dolor qui veniam enim. Sunt
            nisi et uip excepteur aliqua anim dolor. Voluptate sint nisi
            cillum elit sunt.
        </p>
        <p>
            Laboris minim cillum amet magna ipsum ex dolor qui veniam enim. Sunt
            nisi et exercitation aliqua sunt elit duis minim deserunt
            exercitation. Tempor eu amet laborum fugiat nulla. Culpa dolore
            minim aliquip excepteur aliqua anim dolor. Voluptate sint nisi
            cillum elit sunt.
        </p>
    </div>
);

const Users = () => (
    <div>
        <h2>Users</h2>
        <p>
            Tempor eu amet laborum fugiat nulla. Culpa dolore
            minim aliquip excepteur aliqua anim dolor. Voluptate sint nisi
            cillum elit sunt.
        </p>
    </div>
);

const Topics = () => {
    const match = useRouteMatch();
    return (
        <div>
            <h2>Topic List</h2>
            <ul>
                <li>
                    <Link to={`${match.url}/topic-1`}>Topic 1</Link>
                </li>
                <li>
                    <Link to={`${match.url}/topic-2`}>Topic 2</Link>
                </li>
                <li>
                    <Link to={`${match.url}/topic-3`}>Topic 3</Link>
                </li>
                <li>
                    <Link to={`${match.url}/topic-4`}>Topic 4</Link>
                </li>
            </ul>
            <Switch>
                <Route path={`${match.url}/:topicid`}>
                    <Topic />
                </Route>
            </Switch>
        </div>
    );
}

const TopicList = () => {
    const match = useRouteMatch();
    return (
        <>
        </>
    );
}

const Topic = () => {
    const { topicid } = useParams();
    return (
        <>
            <h2>Topic: {topicid}</h2>
            <p>
                Aliqua minim eiusmod sunt qui anim pariatur amet incididunt
                pariatur. Minim quis magna ad esse eiusmod ad aliquip nulla.
                Exercitation occaecat officia sunt in. Consectetur labore
                excepteur dolore reprehenderit adipisicing nisi consequat mollit
                exercitation fugiat. Sit enim excepteur officia sint.
            </p>
            <p>
                Aliqua minim eiusmod sunt qui anim pariatur amet incididunt
                pariatur. Minim quis magna ad esse eiusmod ad aliquip nulla.
                Exercitation occaecat officia sunt in. Consectetur labore
                excepteur dolore reprehenderit adipisicing nisi consequat mollit
                exercitation fugiat. Sit enim excepteur officia sint.
            </p>
            <Link to="/topics">{`<< Back`}</Link>
        </>
    );
};

export default App;
